import "./note.css";

const Note = () => {
    return(
        <div className="note">
            <div className="note-title">
                <span>PBL</span>
                <div className="note-title-date">
                    ~ <span>7</span>/<span>11</span>
                </div>
            </div>
            <hr/>
            <div className="note-content">
                <h5>Note</h5>
                <p>lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
            </div>
        </div>
    )
}

export default Note;
